    return (
        <>
        <Breadcrumb />
        <div className="w-full flex flex-col">
            <div>
                <Carousel className="carousel" />
            </div>


            <div className="flex">
                <ListProduct />
            </div>
        </div>
        </>
    )
}

export default Home;
